package com.example.learnmaps.models;import android.os.Parcel;import android.os.Parcelable;import com.google.firebase.firestore.GeoPoint;import com.google.firebase.firestore.ServerTimestamp;import java.util.Date;public class UserLocationPedagang implements Parcelable{    private UserPedagang userPedagang;    private GeoPoint geo_point;    private @ServerTimestamp Date timestamp;    public UserLocationPedagang(UserPedagang userPedagang, GeoPoint geo_point, Date timestamp) {        this.userPedagang = userPedagang;        this.geo_point = geo_point;        this.timestamp = timestamp;    }    public UserLocationPedagang() {    }    protected UserLocationPedagang(Parcel in) {        userPedagang = in.readParcelable(UserPedagang.class.getClassLoader());    }    public static final Creator<UserLocationPedagang> CREATOR = new Creator<UserLocationPedagang>() {        @Override        public UserLocationPedagang createFromParcel(Parcel in) {            return new UserLocationPedagang(in);        }        @Override        public UserLocationPedagang[] newArray(int size) {            return new UserLocationPedagang[size];        }    };    public UserPedagang getUserPedagang() {        return userPedagang;    }    public void setUserPedagang(UserPedagang userPedagang) {        this.userPedagang = userPedagang;    }    public GeoPoint getGeo_point() {        return geo_point;    }    public void setGeo_point(GeoPoint geo_point) {        this.geo_point = geo_point;    }    public Date getTimestamp() {        return timestamp;    }    public void setTimestamp(Date timestamp) {        this.timestamp = timestamp;    }    @Override    public String toString() {        return "UserLocationPedagang{" +                "userPedagang=" + userPedagang +                ", geo_point=" + geo_point +                ", timestamp=" + timestamp +                '}';    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeParcelable(userPedagang, flags);    }}